import pytest
import base64
import io


from app.lobby_captcha.image import break_interactive_captcha

text_image = ''
drag_icons = ''



def from_base64(base64string):    
    return io.BytesIO(base64.b64decode(base64string))

def test_lobby_captcha():
    text_image = from_base64(text_image).read()
    drag_icons = from_base64(drag_icons).read()
    result = break_interactive_captcha(text_image, drag_icons)
    assert result.lower() == '2', f'Expected 2, got {result}'
